import s from './Header.module.css';

const Header = () => {
    return (
        <div class="container">
            <div class="menu"></div>
            <div class="logo"></div>
            <div class="contacts"></div>
            <div class="user"></div>
            <div class="search"></div>
        </div>
    );
}

export default Header;
